    My internship journey began with building a health check monitor for microservices at Eagleview (link to Eagleview) https://www.eagleview.com/. 
    At Liberty Mutual [link](https://www.libertymutual.com/), I merged code and design by crafting a landing page and icons for their Mainframe team. 
    Chase Cost Management [link](https://www.chasecostmanagement.com/) saw me tackle user interfaces and build a client portal to help users visualize their savings data. 
    Poatek IT Consulting [link](https://www.poatek.com/) honed my skills in automating project tracking with APIs, and finally, at Inward [link](https://www.inwardhq.com/), I streamlined data analysis, ensuring valuable insights were readily available.
  `;

